Need for Speed - ProStreet Cider Port for Mac



This is a full port of ProStreet using Transgaming's Cider 1835 (a.k.a. PoP3 Cider).


This is tested and working on a 20&quot; pre-aluminum iMac running leopard, and should work on tiger too,

if you edit the minimum system version in the info.plist (richt click on the app, show package contents,etc...)


Thanks to ToeD for the ProStreet for windows upload, to bolle for the original (bug-ridden) port,
and special thanks in advance to Transgaming inc. And EA for not suing my ass.



-DJblastyfone


